import {
    EDIT_USER,
    LIST_USER
} from '../../types';

export default(state,action) =>{
    switch(action.type){
        case EDIT_USER:
            return{
                ...state,
                editUser :true
            }
            case LIST_USER:
                return{
                    ...state,
                    listuser : action.payload
                }

        default:
            return state;
    }
}
